margin: 20px;
max-width: 200px;
border-radius: 10px;
`;

const H1 = styled.h1`

color: ${({ theme })=> theme.colors.primary}
text-align: center;

`;

export default function StepCard (){
  return (
      <Card>

          <h3>Titulo 1</h3>
          <p>Descrição</p>
